import {
  ADD_CONTACT,
  DELETE_CONTACT,
  SET_CURRENT,
  CLEAR_CURRENT,
  UPDATE_CONTACT,
  FILTER_CONTACTS,
} from '../types';

export default (state, action) => {
    switch(action.type) {
        case ADD_CONTACT: 
        return {
            ...state,
        }
    }
}
